import { styled } from 'styled-components';
import facebookIcon from '../../assets/img/facebook.svg';
import tweeterIcon from '../../assets/img/tweeter.svg';
import instagramIcon from '../../assets/img/instagram.svg';
import githubIcon from '../../assets/img/instagram.svg';
import linkedinIcon from '../../assets/img/instagram.svg';




const FooterEstilizado = styled.footer`
	display: flex;
	justify-content: space-between;
	align-items: center;
	width: 100%;
    background: rgb(0, 0, 0);
	padding: 2rem;
	box-sizing: border-box;
`;

const IconoContainer = styled.ul`
	margin: 0;
	padding: 0;
	list-style: none;
	li {
    	display: inline-block;
    	margin-right: 10px;
	}
`;

const FooterTexto = styled.p`
	font-size: 16px;
	color: white;
	margin: 0;
`;

const Icono = styled.img`
	max-width: 32px;
	height: auto;
`;

function Footer() {
	return (
    	<FooterEstilizado>
        	<IconoContainer>
            	<li>
                	<a href="#">
                    	<Icono src={facebookIcon} alt="Facebook" />
                	</a>
            	</li>
            	<li>
                	<a href="#">
                    	<Icono src={tweeterIcon} alt="Tweeter" />
                	</a>
            	</li>
            	<li>
                	<a href="#">
                    	<Icono src={instagramIcon} alt="Instagram" />
                	</a>
            	</li>
                <li>
                	<a href="#">
                    	<Icono src={githubIcon} alt="Facebook" />
                	</a>
            	</li>
            	<li>
                	<a href="#">
                    	<Icono src={tweeterIcon} alt="Tweeter" />
                	</a>
            	</li>
        	</IconoContainer>
        	<FooterTexto>Desarrollado por Alejandra Toloza</FooterTexto>
    	</FooterEstilizado>
	);
}

export default Footer;
